import VideoSmall from "./VideoSmall";
import "./videoThumb.css";

const VideoThumb = () => {
    return (
        <div className="videoThumb">
            <VideoSmall />
            <VideoSmall />
            <VideoSmall />
            <VideoSmall />
            <VideoSmall />
            <VideoSmall />
        </div>
    );
};

export default VideoThumb;
